import React from 'react';

// 구조 분해 할당 (destructuring-assignment)
function Food({ name, picture }) {
    return (
        <div>
            <h2> I like {name} </h2>
            <img src={picture} alt={name} />
        </div>
    );
}

const foodILike = [
    {
        id: 1,
        name: 'Pizza',
        image: 'data:image/jpeg;base64,'
    },
    {
        id: 2,
        name: 'Susi',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 3,
        name: 'Bibimbap',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 4,
        name: 'Doncasu',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 5,
        name: 'Samgyeopsal',
        image: 'data:image/jpeg;base64,',
    }
];

function App() {
  return (
      <div>
          {foodILike.map(dish => (
              <Food key={dish.id} name={dish.name} picture={dish.image} />
          ))}
      </div>
  );
}

export default App;